import image from './it-is-i-the-fil.png'
import './projects.css'
{/* 
Notes:
projects and essays should be exactly the same
figure out .map and props for experience and projects.

*/}
export default class Projects extends Component {
  render(){
    return(
        // {/* Here I'll be writing down what I'm working on, and what's still on the plate!
        // <br />
